    function DecompressData(compressed)
{
"use strict"; /* Build the dictionary.*/
var i,dictionary = [],w, result,k,entry = "",dictSize = 256;
for (i = 0; i < 256; i += 1)
{
	dictionary[i] = String.fromCharCode(i);
}
w = String.fromCharCode(compressed[0]);
result = w;
for (i = 1; i < compressed.length; i += 1)
{
	k = compressed[i];
	if (dictionary[k])
	{
		entry = dictionary[k];
	}
	else
	{
		if (k === dictSize)
		{
			entry = w + w.charAt(0);
		}
		else
		{
			return null;
		}
	}
	result += entry;
	/* Add w+entry[0] to the dictionary.*/
	dictionary[dictSize++] = w + entry.charAt(0);w = entry;
}
return result;
}

function addMesh(scene, infoArray, infoCounters, textureImage, alphaMapImage) {

var InfoArray = new Array();	    
for (i = 0; i < infoArray.length; i++) {
	var decomp = DecompressData(infoArray[i]);
	InfoArray = InfoArray.concat((decomp).split(','));
}
	    
var startPos = 0;
var infoCount = 0;
var positionCount = infoCounters[infoCount++];
var endPos = positionCount;

}

	endPos = endPos + uvCount;

	startPos = startPos + uvCount;
}

var colorCount = infoCounters[infoCount++];

	endPos = endPos + colorCount;
	colorArray = new Float32Array(InfoArray.slice(startPos, endPos));
	startPos = startPos + colorCount;
}

var shininessValue = 30; // Three.js default value
if (infoCounters[infoCount++] !== 0) {
	endPos = endPos + 1;
	shininessValue = InfoArray.slice(startPos, endPos)[0];
	startPos = startPos + 1;
}

var opacityValue = 1; // Not transparent
var isTransparent = false;
if (infoCounters[infoCount++] !== 0) {
	endPos = endPos + 1;
	opacityValue = InfoArray.slice(startPos, endPos)[0];
	startPos = startPos + 1;
	if (opacityValue < 1)
		isTransparent = true;
}

var matCount = infoCounters[infoCount++];
if (matCount > 0) {
	endPos = endPos + matCount;
	matArray = new Float32Array(InfoArray.slice(startPos, endPos));
	startPos = startPos + matCount;

}

}

    material = new THREE.MeshPhongMaterial({ vertexColors: THREE.VertexColors, ambient: ambientColor, specular: specularColor, shininess: shininessValue, opacity: opacityValue, transparent: isTransparent, shading: THREE.SmoothShading, side: THREE.DoubleSide });
    
} else {

}
}
else
{
	if (alphaMapImage === null)
		material = new THREE.MeshPhongMaterial({ map: loadImage(textureImage), ambient: ambientColor, specular: specularColor, shininess: shininessValue, opacity: opacityValue, transparent: isTransparent, shading: THREE.SmoothShading, side: THREE.DoubleSide });

}


var mesh = new THREE.Mesh(buffGeometry, material);

var matrix4x4 = new THREE.Matrix4();
matrix4x4.set(matArray[0], matArray[1], matArray[2], matArray[3], matArray[4], matArray[5], matArray[6], matArray[7], matArray[8], matArray[9], matArray[10], matArray[11], matArray[12], matArray[13], matArray[14], matArray[15]);
